import { BrowserRouter, Route, Routes, Redirect } from 'react-router-dom';

import logo from './logo.svg';
import Header from './Components/Header.js'
import Home from './Home.js'
import Contact from './Contact.js'
import Gif from './Gif.js'
import MotionDesign from './MotionDesign.js'
import Director from './Director.js'
import Adidas from './Page/adidas';
import Agaag from './Page/agaag';
import Alb from './Page/alb';
import Cil from './Page/cil';
import Cube from './Page/cube';
import Eleven1 from './Page/eleven1';
import Eleven2 from './Page/eleven2';
import Eleven3 from './Page/eleven3';
import Grieffjoy from './Page/grieffjoy';
import Hanoi from './Page/hanoi';
import Ilek from './Page/ilek';
import JuvenilesTour from './Page/juvenilestour';
import JuvenilesWay from './Page/juvenilesway';
import Ld from './Page/ld';
import Mineo from './Page/mineo';
import Pgreen from './Page/pgreen';
import Tiktok from './Page/tiktok';
import Underworld from './Page/underworld';

import "./App.css"

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route exact path="/" component={Home}>
          </Route>
          <Route path="/contact" component={Contact}>
          </Route>
          <Route path="/gif" component= {Gif}>
          </Route>
          <Route path="/director" component= {Director}>
          </Route>
          <Route path="/motiondesign" component= {MotionDesign}>
          </Route>
          <Route path="/adidas" component= {Adidas}>
          </Route>
          <Route path="/agirlandagun" component= {Agaag}>
          </Route>
          <Route path="/alb" component= {Alb}>
          </Route>
          <Route path="/cil" component= {Cil}>
          </Route>
          <Route path="/thecube" component= {Cube}>
          </Route>
          <Route path="/eleven1" component= {Eleven1}>
          </Route>
          <Route path="/eleven2" component= {Eleven2}>
          </Route>
          <Route path="/eleven3" component= {Eleven3}>
          </Route>
          <Route path="/griefjoy" component= {Grieffjoy}>
          </Route>
          <Route path="/hanoi" component= {Hanoi}>
          </Route>
          <Route path="/ilek" component= {Ilek}>
          </Route>
          <Route path="/juvenilestour" component= {JuvenilesTour}>
          </Route>
          <Route path="/juvenilesway" component= {JuvenilesWay}>
          </Route>
          <Route path="/ld" component= {Ld}>
          </Route>
          <Route path="/mineo" component= {Mineo}>
          </Route>
          <Route path="/pgreen" component= {Pgreen}>
          </Route>
          <Route path="/tiktok" component= {Tiktok}>
          </Route>
          <Route path="/underworld" component= {Underworld}>
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
